import {configureStore, combineReducers, createReducer} from "@reduxjs/toolkit";


const initialState = {
    userName: null,
    userId: null
}
const reducer = {};

const user = createReducer(initialState, reducer)



const rootReduser = combineReducers({
    user: user
});

export const store = configureStore({
    reducer: rootReduser,
})
